def corr():
    query = \
        "select symbol, date, close from day_candle " \
        "where date >= '2022-05-19' " \
        "order by symbol, date "

    con = sqlite3.connect(database_name)
    df = pd.read_sql_query(query, con)
    vals = df.values.tolist()
    idxs = df.index.tolist()

    symbol = ''
    str_ticker = ''
    for indexs, v in zip(idxs, vals):
        if symbol != v[0]:
            if 0 < len(str_ticker):
                print(str_ticker, '],')
            symbol = v[0]
            str_ticker = '"' + symbol + '":['
        str_ticker += str(v[2])+','

    print(str_ticker, ']')

    con.close()


